import React from 'react';
import s from './Categories.module.css'
import Category from "./Category/Category";
import {BrowserRouter, Router, Routes, Route, Switch} from "react-router-dom";

const Categories = (props) => {
  return (
      <BrowserRouter>
        <h3>Выберите категорию</h3>
        <Routes>
          <Route path={"/"} element={
            <div className={s.content}>
              <div className={s.categories}>
                <Category nameCategory={'Недвижимость'} imgPath={'./architect.svg'} className={s.categories}/>
                <Category nameCategory={'Транспорт'} imgPath={'./auto.svg'} className={s.categories}/>
                <Category nameCategory={'Все для дома'} imgPath={'./household.svg'} className={s.categories}/>
              </div>
            </div>
          }>
          </Route>
        </Routes>
      </BrowserRouter>
  );
};

export default Categories;
